import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <button className="btn">Learn React Like Dumb Ass</button>
    </div>
  );
}

function Button() {
  return (
    <div className="App">
      <button className="btn">I Like</button>
    </div>
  );
}

export default App;
